  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The POS file contains data on characteristics
  of hospitals and other types of healthcare facilities, including the name and address
  of the facility and the type of Medicare services the facility provides, among other
  information.  The data are collected through the Centers for Medicare and Medicaid
  Services (CMS) Regional Offices. The file contains an individual record for each
  Medicare-approved provider and is updated quarterly. The data is an invaluable resource
  to a variety of stakeholders, including researchers and application developers.</p>n\",\n\t\"license_title\":
